from heapq import heapify, heappush, heappop


class Fraction:
    def __init__(self, num, den):
        self.num = num
        self.den = den

    def __lt__(self, other):
        return -1*(self.num/self.den) < -1*(other.num/other.den)


class Solution:
    # @param A : list of integers
    # @param B : integer
    # @return a list of integers
    def solve(self, A, B):
        max_heap = []
        heapify(max_heap)

        if len(A)<=2:
            return [1, A[0]]
        for i in range(0, len(A)):
            for j in range (i+1, len(A)):
                if len(max_heap)<B:
                    heappush(max_heap, Fraction(A[i], A[j]))
                else:
                    top = heappop(max_heap)
                    if top < Fraction(A[i], A[j]):
                        heappush(max_heap, Fraction(A[i], A[j]))
                    else:
                        heappush(max_heap, top)
        fraction = heappop(max_heap)
        return [fraction.num, fraction.den]


